import React, { useState, useEffect, useMemo } from "react";
import { useMusicPlayer } from '../context/MusicPlayerContext';
import "./Home.css"; // Styles for rows and headers
import "../components/Search.css"; // Reusing Song Card styles

const MAX_SONGS_PER_ROW = 5;

// --- SongRow Component for horizontal scrolling ---
const SongRow = React.memo(({ title, songs, activeSong, isPlaying, playSong }) => {
    if (!songs || songs.length === 0) return null;

    return (
        <section className="song-section">
            <h2 className="section-title">{title}</h2>
            <div className="song-row-container">
                {songs.slice(0, MAX_SONGS_PER_ROW).map((song) => (
                    <div 
                        key={song.id} 
                        className={`song-card ${activeSong?.id === song.id && isPlaying ? 'is-playing' : ''}`}
                        onClick={() => playSong(song)}
                    >
                        <img 
                            src={song.cover} 
                            alt={song.songname} 
                            className="cover" 
                            // Fallback image using placeholder service (e.g., if cover is missing)
                            onError={(e) => { e.target.onerror = null; e.target.src="https://placehold.co/200x200/404040/ffffff?text=No+Cover"; }}
                        />
                        <h4>{song.songname}</h4>
                        <p>{song.artist.split(',')[0]}</p>
                        {song.movieName && <p className="song-detail">Movie: {song.movieName}</p>}
                    </div>
                ))}
            </div>
        </section>
    );
});


export default function Home() {
    const [allSongs, setAllSongs] = useState([]);
    const { activeSong, isPlaying, playSong } = useMusicPlayer();

    // 1. Fetch All Songs
    useEffect(() => {
        fetch("/songs.json")
          .then((res) => res.json())
          .then((data) => {
            setAllSongs(data);
          })
          .catch((err) => console.error("Error fetching songs:", err));
    }, []);


    // 2. Mock Recently Played (Since we don't track history yet, we'll mock it)
    const recentlyPlayed = useMemo(() => {
        // Mock: Simply take the songs from index 5 to 10 and reverse them to appear "recent"
        // In a real app, this would be retrieved from localStorage or Firebase history.
        return allSongs.slice(5, 10).reverse();
    }, [allSongs]);

    // 3. Trending Songs (Mock: Simply take the top 5 songs)
    const trendingSongs = useMemo(() => {
        return allSongs.slice(0, MAX_SONGS_PER_ROW);
    }, [allSongs]);

    // 4. Tamil Songs (Filter by language)
    const tamilSongs = useMemo(() => {
        return allSongs.filter(song => 
            song.language && song.language.toLowerCase().includes('tamil')
        ).slice(0, MAX_SONGS_PER_ROW);
    }, [allSongs]);

    // 5. English Songs (Filter by language)
    const englishSongs = useMemo(() => {
        return allSongs.filter(song => 
            song.language && song.language.toLowerCase().includes('english')
        ).slice(0, MAX_SONGS_PER_ROW);
    }, [allSongs]);


    return (
        <div className="home-dashboard">
            <h1 className="main-welcome">ðŸŽµ Welcome to My Music Hub</h1>
            
            {/* Display loading message or dashboard content */}
            {allSongs.length === 0 ? (
                <p className="loading-message">Loading your music library...</p>
            ) : (
                <>
                    {/* Row 1: Recently Played */}
                    <SongRow
                        title="Your Recently Played"
                        songs={recentlyPlayed}
                        activeSong={activeSong}
                        isPlaying={isPlaying}
                        playSong={playSong}
                    />

                    {/* Row 2: Global Trending Hits */}
                    <SongRow
                        title="Global Trending Hits"
                        songs={trendingSongs}
                        activeSong={activeSong}
                        isPlaying={isPlaying}
                        playSong={playSong}
                    />
                    
                    {/* Row 3: Top Tamil Melodies */}
                    <SongRow
                        title="Top Tamil Melodies"
                        songs={tamilSongs}
                        activeSong={activeSong}
                        isPlaying={isPlaying}
                        playSong={playSong}
                    />

                    {/* Row 4: International English Favorites */}
                    <SongRow
                        title="International English Favorites"
                        songs={englishSongs}
                        activeSong={activeSong}
                        isPlaying={isPlaying}
                        playSong={playSong}
                    />
                </>
            )}
        </div>
    );
}
